def open_encrypt_window():
    encrypt_window = tk.Toplevel(root)
    encrypt_window.title("Encrypt Text")

    tk.Label(encrypt_window, text="File Path:").grid(row=0, column=0, padx=10, pady=5)
    global file_path_entry
    file_path_entry = tk.Entry(encrypt_window, width=50)
    file_path_entry.grid(row=0, column=1, padx=10, pady=5)
    browse_button = tk.Button(encrypt_window, text="Browse", command=browse_file)
    browse_button.grid(row=0, column=2, padx=10, pady=5)

    tk.Label(encrypt_window, text="Message:").grid(row=1, column=0, padx=10, pady=5)
    message_entry = tk.Entry(encrypt_window, width=50)
    message_entry.grid(row=1, column=1, padx=10, pady=5)

    tk.Label(encrypt_window, text="Sender Email:").grid(row=2, column=0, padx=10, pady=5)
    sender_email_entry = tk.Entry(encrypt_window, width=50)
    sender_email_entry.grid(row=2, column=1, padx=10, pady=5)

    tk.Label(encrypt_window, text="SMTP Password:").grid(row=3, column=0, padx=10, pady=5)
    smtp_password_entry = tk.Entry(encrypt_window, show="*", width=50)
    smtp_password_entry.grid(row=3, column=1, padx=10, pady=5)

    tk.Label(encrypt_window, text="Receiver Email:").grid(row=4, column=0, padx=10, pady=5)
    receiver_email_entry = tk.Entry(encrypt_window, width=50)
    receiver_email_entry.grid(row=4, column=1, padx=10, pady=5)

    # Add an example button for encryption (can be customized for further functionality)
    send_button = tk.Button(encrypt_window, text="Send", command=lambda: encrypt(
        file_path_entry.get(),
        message_entry.get(),
        sender_email_entry.get(),
        smtp_password_entry.get(),
        receiver_email_entry.get()
    ))
    send_button.grid(row=5, column=1, padx=10, pady=10)

def encrypt(file_path, message, sender_email, smtp_password, receiver_email):
    # Example encryption logic (Base64 encoding)
    encoded_message = base64.b64encode(message.encode()).decode()
    print(f"File Path: {file_path}")
    print(f"Original Message: {message}")
    print(f"Encoded Message: {encoded_message}")
    print(f"Sender Email: {sender_email}")
    print(f"SMTP Password: {smtp_password}")
    print(f"Receiver Email: {receiver_email}")
    messagebox.showinfo("Encrypt", "Encryption process has been triggered.\n" + 
                        f"Encoded Message: {encoded_message}")



